import NavBar from "../NavBar";
import TransitionBtn from "../TransitionBtn";

function Home() {
    return (
        <div className="Home" style={{ 

          backgroundImage: `url(${background_image})`,
          height: "100vh",
        }}>
          <NavBar></NavBar>

          <div className="leftLogo" style={{


            zIndex:30,
          }}>
            <img src={logoImage} style={{

              width: 462,
              height: 136,
              left: 143,
              top: 541,
              position: "absolute",
              filter: "drop-shadow(0px, 4px, 4px, rgba(0, 0, 0, 0.25))",
            }}> 
            </img>
          </div>
                     <TransitionBtn navUrl="About"/>



          <div className="rightGif"> 
            <img src={gifImage} alt="gif loading" style={{

              position: "absolute",
            }} />
          </div>


        </div>


      );
}
export default Home;
